import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Ingresos from "./components/Transacciones/Ingresos";
import CrearIngresos from "./components/Transacciones/Ingresos/Form/Crear";
import EditarIngresos from "./components/Transacciones/Ingresos/Form/Editar";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/ingresos" element={<Ingresos />} />
          <Route path="/ingreso/create" element={<CrearIngresos />} />
          <Route path="/ingreso/edit/:id" element={<EditarIngresos />} />

          <Route path="/egresos" element={<Ingresos />} />
          <Route path="/egreso/create" element={<CrearIngresos />} />
          <Route path="/egreso/edit/:id" element={<EditarIngresos />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
